import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [schools, setSchools] = useState([]);
  const [players, setPlayers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");
  const token = localStorage.getItem("token");
  const user = JSON.parse(localStorage.getItem("user") || "{}");

  // Fetch schools and players separately for easier debugging
  useEffect(() => {
    const fetchSchools = async () => {
      setLoading(true);
      setErr("");
      try {
        console.log("Fetching schools...");
        const res = await axios.get("http://localhost:5000/api/schools", {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log("Schools Response:", res.data);
        setSchools(res.data.schools || []);
      } catch (error) {
        console.error("Error fetching schools:", error);
        setErr(error?.response?.data?.message || "Error loading schools.");
      }
      setLoading(false);
    };

    fetchSchools();
  }, [token]);

  // Fetch players only after schools are loaded
  useEffect(() => {
    if (!token || !user.role) return;
    const fetchPlayers = async () => {
      try {
        console.log("Fetching players...");
        const res = await axios.get("http://localhost:5000/api/players", {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log("Players Response:", res.data);
        setPlayers(res.data.players || []);
      } catch (error) {
        console.error("Error fetching players:", error);
        setErr(error?.response?.data?.message || "Error loading players.");
      }
    };
    fetchPlayers();
  }, [token, user.role]);

  if (loading) return <div>Loading...</div>;
  if (err) return <div className="text-red-500">{err}</div>;

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Super Admin Dashboard</h1>
      <h2 className="text-xl font-semibold mb-2">Schools</h2>
      <table className="min-w-full text-sm mb-8">
        <thead>
          <tr className="bg-blue-600 text-white">
            <th className="p-2 text-left">Name</th>
            <th className="p-2 text-left">Address</th>
            <th className="p-2 text-left">Email</th>
          </tr>
        </thead>
        <tbody>
          {schools.map((s) => (
            <tr key={s.id} className="border-b last:border-none">
              <td className="p-2">{s.name}</td>
              <td className="p-2">{s.address}</td>
              <td className="p-2">{s.email}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <h2 className="text-xl font-semibold mb-2">Players</h2>
      <table className="min-w-full text-sm">
        <thead>
          <tr className="bg-blue-600 text-white">
            <th className="p-2 text-left">Name</th>
            <th className="p-2 text-left">School</th>
            <th className="p-2 text-left">DOB</th>
          </tr>
        </thead>
        <tbody>
          {players.map((p) => (
            <tr key={p.id} className="border-b last:border-none">
              <td className="p-2">{p.full_name}</td>
              <td className="p-2">{p.school_name || p.school_id}</td>
              <td className="p-2">{p.dob}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
